string1 = ""
string2 = ""

def calculate_hamming_distance(string_for, string_rev):  
    hamming_distance = 0

    for i in range(len(string_for)):
        if string_for[i] != string_rev[i]:
            hamming_distance += 1

    return hamming_distance
        
calculate_hamming_distance(string1, string2)